      name: "Abdulmalik",
      jobName: "Front-End Developer",
      email: "abdulmalikkld325@gmail.com",
      web: "abdulmalik-frontEnd.eb2a.com",
    },
    {
      img: "https://cdn5.vectorstock.com/i/1000x1000/29/74/young-man-face-cartoon-design-vector-9772974.jpg",
      name: "Rabih",
      jobName: "Back-End Developer",
      email: "rabih@gmail.com",
      web: "rabih-backend.com",
    },
    {
      img: "https://previews.123rf.com/images/jemastock/jemastock1704/jemastock170400913/75057182-happy-man-face-cartoon-icon-over-white-background-colorful-design-vector-illustration.jpg",
      name: "Abdulrahman",
      jobName: "Full-Stack Developer",
      email: "",
      web: "abood-fullStack.org",
    },
    {
      img: "https://media.istockphoto.com/vectors/young-man-face-cartoon-vector-id894021378",
      name: "Rawwad",
      jobName: "React Native Developer",
      email: "",
      web: "",
    },
    {
      img: "https://cdn3.vectorstock.com/i/1000x1000/63/42/young-man-face-cartoon-vector-19116342.jpg",
      name: "Ahmad",
      jobName: "JavaScript Developer",
      email: "abmad@gmail.com",
      web: "",
    },
  ];
  let members = info.map((member) => {
    <Task
      img={member.img}
      name={member.name}
      jobName={member.jobName}
      email={member.email}
      web={member.web}
    />;
  });
  return <div>{members}</div>;
}

export default Learn;
